import React, { Component } from 'react';

export default class Table extends Component{

	constructor(props) {
        super(props)
    
        this.state = {
            dataList : ''
        }
    }

	//var url = 'http://jsonplaceholder.typicode.com/todos';
	componentDidMount(){
		fetch('http://jsonplaceholder.typicode.com/todos').
		then((response) => response.json()).
		then((findresponse) => {
			//console.log(findresponse);
			this.setState({
				dataList: findresponse,
			})
		})
	}
	render(){
		var data = this.state.dataList;
		return(
			<table className="table table-bordered">
			    <thead>
			      <tr>
			        <th>Title</th>
			        <th>Completed</th>
			        <th>Action</th>
			      </tr>
			    </thead>
			    <tbody>
			    { data.map((data,index) => 
			    	(
					    <tr key={index}>
					        <td>{data.title}</td>
					        <td>{data.completed}</td>
					        <td>Action</td>
					    </tr>
			    ))}
			    </tbody>
			  </table>
		)
	}
}
